import React from 'react';
import NextVideoData from '../../data/videos.json';
import NextVideosList from './NextVideosList';
import './next-videos.scss';

function NextVideos() {

    const videoListJsx = NextVideoData.map((element, index) => {
        return <NextVideosList videoList ={element} key={'video' + index} />;
    })

    return (
        <section className="next-videos">
            <h2>NEXT VIDEOS</h2>
            {videoListJsx}
        </section>
    )
}

export default NextVideos
